import { BrowserRouter, Route, Routes } from "react-router-dom";

import HomePage from "./components/scenes/homePage";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
